def calculate( calllist, sample_range_list, last_step_list,calculationlist):
    '''

    :param calllist: 通话记录
    :param sample_rangelist: 样本范围
    :param last_step_list: 符合条件的通话记录
    :param calculationlist: 计算方式
    :return: {计算方式：{样本范围：[计算结果]}}
    '''
    result_dict = {}
    sample_range_dict = Samplerange.get_sample_range(sample_range_list, calllist)

    for calculation in calculationlist:
        result_dict[calculation] = calculation_dict[calculation](calllist,sample_range_dict ,last_step_list)

    #print(result_dict)
    return result_dict


