def get_day_range(start , end):
    '''
    获取一天为单位时间列表
    :param start:
    :param end:
    :return:
    '''
    result_list=[]
    try:
        start_time = datetime.datetime.strptime(start , '%Y-%m-%d')
        end_time = datetime.datetime.strptime(end, '%Y-%m-%d')
        temp_time = start_time
        while temp_time<= end_time:
            result_list.append(temp_time.strftime('%Y-%m-%d'))
            temp_time=temp_time+datetime.timedelta(days=1)
    except Exception as e:
        logger.error(e)
    return result_list

def get_month_range(start , end):
    '''
    获取以月为单位的时间列表Y-m-d 结果只取年月
    :param start:
    :param end:
    :return:
    '''
    result_list = []
    try:
        start_time = datetime.datetime.strptime(start, '%Y-%m-%d')
        end_time = datetime.datetime.strptime(end, '%Y-%m-%d')
        temp_time = start_time
        while temp_time <= end_time:
            temp_time1 = temp_time + datetime.timedelta(days=1)
            if temp_time1.month-temp_time.month==1:
                result_list.append(temp_time1.strftime('%Y-%m-%d')[:7])
            temp_time = temp_time1
    except Exception as e:
        logger.error(e)
    return result_list

